// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";

/// @title Base auction functionality lovingly borrowed from CryptoKitties
/// @author Axiom Zen (https://www.axiomzen.co)
contract ClockAuctionBase is ERC721Holder {
    // Represents an auction for a NonFungibleToken
    struct Auction {
        // Current owner of the token
        address payable seller;

        // Price (in wei) at beginning of auction
        uint128 startingPrice;

        // Price (in wei) at end of auction
        uint128 endingPrice;

        // Duration (in seconds) of auction
        uint64 duration;

        // Timestamp for when the auction started
        // NOTE: will be set to 0 if this auction has ended
        uint64 startedAt;
    }

    //Generic interface for any ERC721 token contract
    IERC721 public tokenContract;

    // Cut owner takes on each auction, measured in basis points (1/100 of a percent).
    // Values 0-10000 map to 0%-100%
    uint256 public ownerCut;

    // Map from a token ID to its corresponding auction
    mapping (uint256 => Auction) tokenIdToAuction;

    // We will broadcast an event with every important auction action that occurs
    event AuctionCreated(uint256 indexed tokenId, uint256 startingPrice, uint256 endingPrice, uint256 duration, uint64 timestamp);
    event AuctionSuccessful(uint256 indexed tokenId, uint256 salePrice, address indexed winner, uint64 timestamp);
    event AuctionCancelled(uint256 indexed tokenId, uint64 timestamp);

    /// We don't want someone to be able to accidentally send funds to this contract so we 
    /// ensure the fallback function is not payable
    fallback() external {}

    // Modifiers to check that inputs can be safely stored with a certain
    // number of bits. We use constants and multiple modifiers to save gas.
    modifier canBeStoredWith64Bits(uint256 _value) {
        require(_value <= 18446744073709551615, "Value exceeds 64 bits");
        _;
    }

    modifier canBeStoredWith128Bits(uint256 _value) {
        require(_value < 340282366920938463463374607431768211455, "Value exceeds 128 bits");
        _;
    }

    /// @dev Returns true if the claimant owns the token
    /// @param _claimant - Address claiming to own the token
    /// @param _tokenId - ID of token requiring ownership verification
    function _senderOwnsToken(address _claimant, uint256 _tokenId) internal view returns (bool) {
        return (tokenContract.ownerOf(_tokenId) == _claimant);
    }

    /// @dev Escrow the token being auctioned by assigning ownership to this contract
    /// Throws if the escrow fails.
    /// @param _owner - Current owner of token to be escrowed
    /// @param _tokenId - ID of token to be escrowed
    function _escrow(address _owner, uint256 _tokenId) internal {
        // This call will 'throw' if the escrow transfer fails
        tokenContract.safeTransferFrom(_owner, address(this), _tokenId);
    }

    /// @dev Transfer a token owned by this contract to another address (either the auction 
    ///      winner or the original owner)
    /// Returns true if the transfer succeeds.
    /// @param _receiver - Address to transfer NFT to.
    /// @param _tokenId - ID of token to transfer.
    function _transfer(address _receiver, uint256 _tokenId) internal {
        // This call will 'throw' if the transfer fails
        tokenContract.safeTransferFrom(address(this), _receiver, _tokenId);
    }

    /// @dev Adds an auction to the list of open auctions. 
    ///      Also fires the AuctionCreated event.
    /// @param _tokenId The ID of the token to be auctioned
    /// @param _auction Auction data object
    function _addAuction(uint256 _tokenId, Auction memory _auction) internal {
        // Require that all auctions have a duration of
        // at least one minute. (Keeps our math from getting hairy!)
        require(_auction.duration >= 1 minutes, "Invalid auction duration");

        tokenIdToAuction[_tokenId] = _auction;
        
        emit AuctionCreated(
            uint256(_tokenId),
            uint256(_auction.startingPrice),
            uint256(_auction.endingPrice),
            uint256(_auction.duration),
            uint64(_auction.startedAt)
        );
    }

    /// @dev Cancels an auction (unconditionally)
    function _cancelAuction(uint256 _tokenId, address _seller) internal {
        _removeAuction(_tokenId);
        _transfer(_seller, _tokenId);
        emit AuctionCancelled(_tokenId, uint64(block.timestamp));
    }

    /// @dev Compute the current price and transfer proceeds
    /// This function does NOT transfer ownership of token
    function _bid(uint256 _tokenId, uint256 _bidAmount) internal returns (uint256 _price) {
        // Get a reference to the auction struct
        Auction storage auction = tokenIdToAuction[_tokenId];

        // Explicitly check that this auction is currently live.
        // (Because of how Ethereum mappings work, we can't just count
        // on the lookup above failing. An invalid _tokenId will just
        // return an auction object that is all zeros.)
        require(_isOnAuction(auction), "Auction is not live");

        // Check that the incoming bid is higher than the current price
        _price = _currentPrice(auction);
        require(_bidAmount >= _price, "Bid amount is below current price");

        // Store the seller address before the auction struct is deleted
        address payable _seller = auction.seller;

        // The bid is good! Remove the auction before sending the fees
        // to the sender so we can't have a re-entrancy attack.
        _removeAuction(_tokenId);

        // Transfer proceeds to the seller (if there are any!)
        if (_price > 0) {
            // Calculate the auctioneer's cut
            // (NOTE: _computeCut() is guaranteed to return a
            // value <= price, so this subtraction can't go negative.)
            uint256 _auctioneerCut = _computeCut(_price);
            uint256 _sellerProceeds = _price - _auctioneerCut;

            // NOTE: Doing a transfer() in the middle of a complex
            // method like this is generally discouraged because of
            // re-entrancy attacks and DoS attacks if the seller is
            // a contract with an invalid fallback function. We explicitly
            // guard against re-entrancy attacks by removing the auction
            // before calling transfer(), and the only thing the seller
            // can DoS is the sale of their own asset! (And if it's an
            // accident, they can call cancelAuction().)
            _seller.transfer(_sellerProceeds);
        }

        // The auctioneer yells 'Going, going, gone!'
        emit AuctionSuccessful(_tokenId, _price, msg.sender, uint64(block.timestamp));

        return _price;
    }

    /// @dev Remove an auction from the list of open auctions
    /// @param _tokenId - ID of the token on auction
    function _removeAuction(uint256 _tokenId) internal {
        delete tokenIdToAuction[_tokenId];
    }

    /// @dev Check if the token is currently on auction
    /// Returns true if it is
    /// @param _auction - Auction to check
    function _isOnAuction(Auction storage _auction) internal view returns (bool) {
        return (_auction.startedAt > 0);
    }

    /// @dev Return current auction price. 
    ///  Broken into two functions: (this one, that computes the duration 
    ///  from the auction struct, and the other that does the price computation) 
    ///  so we can easily test that the price computation works correctly.
    function _currentPrice(Auction storage _auction) internal view returns (uint256) {
        uint256 _secondsPassed = 0;
        
        // A bit of insurance against negative values (or wraparound).
        // Probably not necessary (since Ethereum guarantees that the
        // now variable doesn't ever go backwards).
        if (block.timestamp > _auction.startedAt) {
            _secondsPassed = block.timestamp - _auction.startedAt;
        }

        return _computeCurrentPrice(
            _auction.startingPrice,
            _auction.endingPrice,
            _auction.duration,
            _secondsPassed
        );
    }

    /// @dev Computes the current price of an auction. Factored out
    ///  from _currentPrice so we can run extensive unit tests.
    ///  When testing, make this function public and turn on
    ///  `Current price computation` test suite.
    function _computeCurrentPrice(
        uint256 _startingPrice, 
        uint256 _endingPrice, 
        uint256 _duration, 
        uint256 _secondsPassed
    ) internal pure returns (uint256) {
        // NOTE: We don't use SafeMath (or similar) in this function because
        //  all of our public functions carefully cap the maximum values for
        //  time (at 64-bits) and currency (at 128-bits). _duration is
        //  also known to be non-zero (see the require() statement in
        //  _addAuction())
        if (_secondsPassed >= _duration) {
            // We've reached the end of the dynamic pricing portion
            // of the auction, just return the end price.
            return _endingPrice;
        }
        
        // Starting price can be higher than ending price, so
        // this delta can be negative.
        int256 totalPriceChange = int256(_endingPrice) - int256(_startingPrice);
        
        // This multiplication can't overflow, _secondsPassed will easily fit within
        // 64-bits, and totalPriceChange will easily fit within 128-bits, their product
        // will always fit within 256-bits.
        int256 currentPriceChange = totalPriceChange * int256(_secondsPassed) / int256(_duration);
        
        // currentPriceChange can be negative, but if so, will have a magnitude
        // less that _startingPrice. Thus, this result will always end up positive.
        int256 currentPrice = int256(_startingPrice) + currentPriceChange;
        
        return uint256(currentPrice);
    }

    /// @dev Computes owner's cut of a sale
    /// @param _price - Sale price of the token
    function _computeCut(uint256 _price) internal view returns (uint256) {
        // NOTE: We don't use SafeMath (or similar) in this function because
        //  all of our entry functions carefully cap the maximum values for
        //  currency (at 128-bits), and ownerCut <= 10000 (see the require()
        //  statement in the ClockAuction constructor). The result of this
        //  function is always guaranteed to be <= _price.
        return _price * ownerCut / 10000;
    }
}

